INSERT INTO `tbl_baiviet` (`id`, `tenbaiviet`, `tomtat`, `noidung`, `id_danhmuc`, `tinhtrang`, `hinhanh`) VALUES
(1, 'Hành trình của CEO Vũ Bảo Khánh', '<p>Để c&oacute; thể x&acirc;y dựng được trang web b&aacute;n h&agrave;ng trực tuyết như h&ocirc;m nay CEO Kh&aacute;nh đ&atilde; phải trải qua những g&igrave;?</p>\r\n', '<h2>1. CEO Kh&aacute;nh l&agrave; ai?</h2>\r\n\r\n<p>CEO Kh&aacute;nh sinh năm 2002 tại Th&aacute;i Nguy&ecirc;n c&oacute; t&ecirc;n đầy đủ l&agrave; Vũ Bảo Kh&aacute;nh - &Ocirc;ng l&agrave; một trong những doanh nh&acirc;n ti&ecirc;n phong trong lĩnh vực c&ocirc;ng nghệ tại Việt Nam. Hiện &ocirc;ng đang giữ ᴄhứᴄ ᴠụ Chủ tịᴄh Tập đo&agrave;n OverGod - tập đo&agrave;n ѕở hữu nhiều thương hiệu ᴄ&ocirc;ng nghệ t&ecirc;n tuổi như mPoS, VIMO, Boxme, FaѕtGo, Ng&acirc;n Lượng&hellip;Một hệ sinh th&aacute;i với gần 30 nền tảng c&ocirc;ng nghệ tại Việt Nam v&agrave; 5 thị trường kh&aacute;c tại Đ&ocirc;ng Nam &Aacute; v&agrave; Trung Quốc.</p>\r\n\r\n<p>Tập đo&agrave;n OverGod từ l&acirc;u kh&ocirc;ng c&ograve;n l&agrave; c&aacute;i t&ecirc;n xa lạ tr&ecirc;n thị trường khởi nghiệp. OverGod phần lớn hoạt động tr&ecirc;n c&aacute;c lĩnh vực như thương mại điện tử, c&ocirc;ng nghệ t&agrave;i ch&iacute;nh hay gi&aacute;o dục c&ocirc;ng nghệ v&agrave; dịch vụ hậu cần&hellip;Hiện nay, tập Đo&agrave;n NextTech đang sở hữu một chuỗi c&aacute;c dự &aacute;n lớn như FastGo, Ng&acirc;n Lượng, Vimo hay mPOS&hellip;</p>\r\n\r\n<p>&Ocirc;ng từng được b&igrave;nh chọn trong Top những người c&oacute; đ&oacute;ng g&oacute;p cho sự ph&aacute;t triển của Internet tại Việt Nam giai đoạn 20015 &ndash; 2017.</p>\r\n\r\n<p style=\"margin-left:200px\"><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<p style=\"margin-left:360px\">&nbsp;</p>\r\n\r\n<p>Bắt đầu lập nghiệp từ những năm 2020, CEO Kh&aacute;nh đ&atilde; được truyền th&ocirc;ng, b&aacute;o ch&iacute; nhắc đến như một trong những gi&aacute;m đốc trẻ nhất Việt Nam, th&agrave;nh lập doanh nghiệp từ năm 19 tuổi.<br />\r\n<br />\r\nCEO Kh&aacute;nh kiếm&nbsp;được một khoản tiền lớn từ l&agrave;m Startup c&ocirc;ng nghệ v&agrave; b&aacute;n vốn cổ phần cho nh&agrave; đầu tư b&ecirc;n ngo&agrave;i. Tuy nhi&ecirc;n, sau khi kiếm được 1 triệu USD mới l&agrave; sự kh&aacute;c biệt của doanh nh&acirc;n n&agrave;y.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>2. Đam m&ecirc; c&ocirc;ng nghệ từ nhỏ</h2>\r\n\r\n<p><strong>Từ khi c&ograve;n nhỏ</strong>, &Ocirc;ng đ&atilde; c&oacute; niềm đam m&ecirc; c&ocirc;ng nghệ rất lớn, khi &ocirc;ng vừa tiếp x&uacute;c lần đầu ti&ecirc;n với m&aacute;y t&iacute;nh th&igrave; bản th&acirc;n đ&atilde; cảm thấy&nbsp;<strong>lĩnh vực c&ocirc;ng nghệ th&ocirc;ng tin</strong>&nbsp;ch&iacute;nh l&agrave; một&nbsp;điều g&igrave; đ&oacute; v&ocirc; c&ugrave;ng b&iacute; ẩn, ở trong đ&oacute; chứa rất nhiều th&ocirc;ng tin hay v&agrave; bổ &iacute;ch.</p>\r\n\r\n<p><strong>V&agrave;o thời sinh vi&ecirc;n,&nbsp;</strong>&Ocirc;ng đ&atilde; từng tham gia rất nhiều cuộc thi t&agrave;i năng ở trong lĩnh vực c&ocirc;ng nghệ th&ocirc;ng tin v&agrave; kết quả &ocirc;ng đ&atilde; gi&agrave;nh được rất nhiều giải thường c&oacute; gi&aacute; trị cao, điển h&igrave;nh nhất l&agrave;&nbsp;<strong>cuộc thi Tr&iacute; Tuệ Việt Nam</strong>&nbsp;hay&nbsp;<strong>T&agrave;i năng trẻ tin học</strong>,&nbsp;<strong>Tuổi trẻ s&aacute;ng tạo</strong>&hellip;</p>\r\n\r\n<p><strong>Khi l&ecirc;n Đại Học</strong>, &ocirc;ng thi v&agrave;o trường Đại Học C&ocirc;ng Nghệ Th&ocirc;ng Tin &amp; Truyền Th&ocirc;ng Th&aacute;i Nguy&ecirc;n, tại thời điểm đ&oacute;, với số vốn &iacute;t ỏi chỉ c&oacute; 2 triệu đồng, nhưng &ocirc;ng đ&atilde; quyết định th&agrave;nh lập c&ocirc;ng ty ri&ecirc;ng của m&igrave;nh c&oacute; t&ecirc;n l&agrave; PeaceSoft, khi đ&oacute; c&aacute;c dự &aacute;n ở trong PeaceSoft phần lớn l&agrave; gia c&ocirc;ng phần mềm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>3. Con đường sự nghiệp của CEO Kh&aacute;nh</h2>\r\n\r\n<p><strong>Khởi nghiệp khi mới 19 tuổi:&nbsp;</strong>Ngay từ những năm c&ograve;n tr&ecirc;n ghế giảng đường, &Ocirc;ng đ&atilde; th&agrave;nh lập c&ocirc;ng ty ri&ecirc;ng tr&ecirc;n nền tảng Internet đầu ti&ecirc;n mang t&ecirc;n PeaceSoft với số vốn 2 triệu đồng.&nbsp; Đ&acirc;y l&agrave; một trong những start-up c&ocirc;ng nghệ đầu ti&ecirc;n của Việt Nam chuy&ecirc;n gia c&ocirc;ng phần mềm.</p>\r\n\r\n<p>Năm 2003. Trong Hội thảo Net Booking lớn nhất của kinh doanh ch&acirc;u &Aacute;. Sau sự kiện n&agrave;y,&nbsp; Quỹ đầu tư mạo hiểm IDG quyết định đầu tư v&agrave; l&agrave; bước ngoặt ph&aacute;t triển của PeaseSoft. Nhưng trong v&ograve;ng 7 năm hoạt động của PeaceSoft c&ocirc;ng việc gia c&ocirc;ng phần mềm theo y&ecirc;u cầu của kh&aacute;ch h&agrave;ng. &Ocirc;ng nhận thấy đ&acirc;y l&agrave; c&ocirc;ng việc c&oacute; nhiều bắt cập, hao tốn nhiều tiền của nhưng kh&ocirc;ng c&oacute; lời nhiều.</p>\r\n\r\n<p>Theo đ&oacute;, &Ocirc;ng đ&atilde; quyết định chuyển từ m&ocirc; h&igrave;nh đ&oacute; sang m&ocirc; h&igrave;nh thương mại điển tử, trang thương mại điện tử Chodientu.vn của &ocirc;ng đ&atilde; bắt đầu x&acirc;y dựng v&agrave; ph&aacute;t triển. Đ&acirc;y l&agrave; dự &aacute;n ti&ecirc;n phong trong ng&agrave;nh TMĐT Việt Nam. Chodientu l&agrave; nơi mang lại nhiều tiện lợi cho kh&aacute;ch h&agrave;ng mua sắm online. &Yacute; tưởng cũng xuất ph&aacute;t từ m&ocirc; h&igrave;nh eBay v&agrave; Alibaba, c&ugrave;ng với sự đầu tư của quỹ IDG Ventures.</p>\r\n\r\n<p>Sau thất bại tại thị trường Trung Quốc, Tập đo&agrave;n eBay (Mỹ) quay sang Đ&ocirc;ng Nam &Aacute; v&agrave; chọn PeaceSoft l&agrave;m đối t&aacute;c kinh doanh thương mại điện tử tại Việt Nam. Tuy nhi&ecirc;n, thời kỳ &ldquo;hưng thịnh&rdquo; của PeaceSoft nhanh ch&oacute;ng qua đi khi Lazada, Shopee tấn c&ocirc;ng thị trường Việt Nam. EBay cũng kh&ocirc;ng muốn đốt tiền v&agrave; nhanh ch&oacute;ng ngưng hợp t&aacute;c với &ocirc;ng B&igrave;nh.<br />\r\n<br />\r\nV&agrave;o năm 2016 th&igrave; PeaceSoft t&aacute;i cấu tr&uacute;c theo m&ocirc; h&igrave;nh tập đo&agrave;n để kh&ocirc;ng dừng lại ở thị trường thương mại điện tử m&agrave; tham gia v&agrave;o cuộc chơi lớn hơn l&agrave; điện tử h&oacute;a thương mại với tổng doanh số b&aacute;n lẻ l&ecirc;n đến 110 tỷ USD/năm, v&agrave; cũng từ đ&oacute; m&agrave; c&aacute;i t&ecirc;n Nguyễn Ho&agrave; B&igrave;nh đ&atilde; đổi t&ecirc;n c&ocirc;ng ty th&agrave;nh lập tập đo&agrave;n NextTech.</p>\r\n\r\n<p><strong>NextTech &ndash; th&agrave;nh c&ocirc;ng lớn của CEO Kh&aacute;nh:&nbsp;</strong>Năm 2016 l&agrave; một bước chuyển m&igrave;nh thứ hai của PeaceSoft. &Ocirc;ng tiến h&agrave;nh t&aacute;i cấu tr&uacute;c doanh nghiệp theo m&ocirc; h&igrave;nh tập đo&agrave;n v&agrave; đổi t&ecirc;n th&agrave;nh NextTech. Mục đ&iacute;ch của việc chuyển đổi nhằm đưa c&ocirc;ng ty tham gia v&agrave;o cuộc chơi lớn hơn: điện tử h&oacute;a thương mại với tổng doanh số b&aacute;n lẻ l&ecirc;n đến 100 tỷ đ&ocirc; mỗi năm.<br />\r\n<br />\r\n&Ocirc;ng đổi t&ecirc;n c&ocirc;ng ty th&agrave;nh NextTech v&agrave; x&acirc;y dựng hệ sinh th&aacute;i với 20 dịch vụ điện tử h&oacute;a hoạt động tại Việt Nam v&agrave;&nbsp;8 thị trường kh&aacute;c tại Đ&ocirc;ng Nam &Aacute;&nbsp;v&agrave; Trung Quốc trong 4 lĩnh vực thương mại điện tử, c&ocirc;ng nghệ t&agrave;i ch&iacute;nh, dịch vụ hậu cần v&agrave; gi&aacute;o dục</p>\r\n\r\n<p>B&ecirc;n cạnh th&agrave;nh c&ocirc;ng kể tr&ecirc;n, doanh nghiệp c&ograve;n sở hữu nhiều thương hiệu c&ocirc;ng nghệ ti&ecirc;n tiến nhất hiện nay như: FastGo, mPOS, VIMO.vn, Ng&acirc;n Lượng, Boxme&hellip; Tổng sản lượng giao dịch điện tử h&agrave;ng năm ướt đạt 3 tỷ đ&ocirc;. Với số lượng nh&acirc;n vi&ecirc;n l&ecirc;n đến 200 người tại 8 quốc gia trong khu vực.<br />\r\nNextTech từng được v&iacute; như &ldquo;Alibaba của Việt Nam&rdquo;. Doanh nghiệp n&agrave;y c&ograve;n được bầu chọn l&agrave; 1 trong 10 c&ocirc;ng ty&nbsp; c&oacute; ảnh hưởng đến sự ph&aacute;t triển Internet của Việt Nam .<br />\r\n<br />\r\nNg&agrave;y 9/2/2020, Tập đo&agrave;n NextTech đ&atilde; ch&iacute;nh thức khai trương cơ sở thời trang t&oacute;c mang thương hiệu Hair Station đầu ti&ecirc;n tại số 139 B&ugrave;i Thị Xu&acirc;n, Hai B&agrave; Trưng, H&agrave; Nội.<br />\r\n<br />\r\nVới gần 20 năm đầu tư v&agrave; ph&aacute;t triển trong lĩnh vực c&ocirc;ng nghệ, mục ti&ecirc;u của NextTech năm nay sẽ mở rộng đầu tư th&ecirc;m v&agrave;o c&aacute;c lĩnh vực kh&aacute;c l&agrave; thời trang t&oacute;c, đặc biệt l&agrave; kh&aacute;ch h&agrave;ng l&agrave; nam giới.</p>\r\n\r\n<p>Thấu hiểu trước t&iacute;nh đ&agrave;o thải khốc liệt của c&aacute;c startup c&ocirc;ng nghệ, &Ocirc;ng&nbsp;v&agrave; NextTech đ&atilde; th&agrave;nh lập Quỹ hỗ trợ khởi nghiệp giai đoạn sớm Next100 với quy m&ocirc; 10 triệu USD lai gh&eacute;p từ 3 m&ocirc; h&igrave;nh Venture Builder &ndash; Ecosystem &ndash; Venture Capital.</p>\r\n\r\n<p>Quỹ ra đời với mong muốn n&acirc;ng cao năng lực v&agrave; l&agrave;m bệ ph&oacute;ng cho h&agrave;ng trăm Startup Việt th&agrave;nh c&ocirc;ng tại thị trường trong nước v&agrave; vươn ra Đ&ocirc;ng Nam &Aacute;. Đồng thời quỹ cũng mong muốn đầu tư v&agrave;o c&aacute;c Startup c&ocirc;ng nghệ mới độc đ&aacute;o trong khu vực. Đồng thời, doanh nghiệp cũng đ&oacute;ng vai tr&ograve; l&agrave; mentor tư vấn, huấn luyện đồng thời hỗ trợ chiến lược&nbsp;mọi mặt cho c&aacute;c startup Việt.</p>\r\n\r\n<p><br />\r\nB&ecirc;n cạnh Quỹ đầu tư NexTech100, &Ocirc;ng cũng b&agrave;y tỏ mong muốn &ldquo;mang đến c&aacute;ch kinh doanh, kinh nghiệm v&agrave; nguồn lực g&oacute;p phần x&acirc;y dựng hệ sinh th&aacute;i khởi nghiệp Việt Nam đủ sức cạnh tranh ở tầm khu vực&rdquo;.<br />\r\n<br />\r\nChủ tịch NextTech cũng từng được bầu chọn trong Top những người c&oacute; ảnh hưởng đến sự ph&aacute;t triển của Internet Việt Nam giai đoạn 2007-2017.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style=\"margin-left:360px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:360px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:360px\">&nbsp;</p>\r\n', 2, 1, '1678113693_anhvbk6.jpg');
INSERT INTO `tbl_baiviet` (`id`, `tenbaiviet`, `tomtat`, `noidung`, `id_danhmuc`, `tinhtrang`, `hinhanh`) VALUES
(3, 'Nguồn gốc của tên OverGod là gì?    ', '<p>Khi mua sản phẩm tại trang web của ch&uacute;ng t&ocirc;i chắc hẳn một số người đều c&oacute; chung một c&acirc;u hỏi về &yacute; nghĩa của t&ecirc;n shop OverGod l&agrave; g&igrave; phải kh&ocirc;ng n&agrave;o?</p>\r\n', '<p><em>OverGod&nbsp; - Kho&aacute;c l&ecirc;n niềm vui gia đ&igrave;nh Việt</em></p>\r\n\r\n<p>Năm 2019, C&ocirc;ng ty Cổ phần Thương mại v&agrave; Dịch vụ Ho&agrave;ng Dương được th&agrave;nh lập với mục đ&iacute;ch ch&iacute;nh ban đầu l&agrave; hoạt động trong lĩnh vực sản xuất h&agrave;ng thời trang xuất khẩu với c&aacute;c sản phẩm chủ yếu l&agrave;m từ len v&agrave; sợi.</p>\r\n\r\n<p>Năm 2023 thương hiệu thời trang OVERGOD ra đời, tự h&agrave;o trở th&agrave;nh một cột mốc đ&aacute;ng nhớ của doanh nghiệp Việt trong ng&agrave;nh thời trang.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:80px\"><img src=\"http://localhost:81/thuctapcsdl/admincp/modules/quanlybaiviet/uploads/1678116823_logochannel.png\" /></p>\r\n\r\n<h2>Tầm nh&igrave;n v&agrave; sứ mệnh</h2>\r\n\r\n<p><em>Mang đến niềm vui cho h&agrave;ng triệu gia đ&igrave;nh Việt</em></p>\r\n\r\n<p>OverGod hướng đến mục ti&ecirc;u mang lại niềm vui mặc mới mỗi ng&agrave;y cho h&agrave;ng triệu người ti&ecirc;u d&ugrave;ng Việt. Ch&uacute;ng t&ocirc;i tin rằng người d&acirc;n Việt Nam cũng đang hướng đến một cuộc sống năng động, t&iacute;ch cực hơn.</p>\r\n\r\n<h3>Kinh doanh dựa tr&ecirc;n gi&aacute; trị thật:</h3>\r\n\r\n<p>OverGod thiết lập hệ thống ti&ecirc;u chuẩn chất lượng quốc tế &aacute;p dụng tr&ecirc;n tất cả quy tr&igrave;nh quản l&yacute; v&agrave; kiểm so&aacute;t chất lượng từ kh&acirc;u chọn lọc nguy&ecirc;n phụ liệu cho đến kh&acirc;u thiết kế v&agrave; sản xuất (Oeko-tex, Cotton USA, Woolmark,...).</p>\r\n\r\n<p><strong><em>Vận h&agrave;nh xanh:&nbsp;</em></strong>Tổ hợp OverGod Văn Giang tự h&agrave;o l&agrave; một đơn vị ti&ecirc;n phong nhận chứng chỉ quốc tế LEED về tiết kiệm năng lượng v&agrave; ảnh hưởng t&iacute;ch cực đến m&ocirc;i trường sống.</p>\r\n\r\n<p><strong><em>Đối t&aacute;c xanh:&nbsp;</em></strong>Canifa chọn Cotton USA - đơn vị cung cấp nguy&ecirc;n liệu ch&iacute;nh cho sản phẩm tại CANIFA, lu&ocirc;n nghi&ecirc;m minh tu&acirc;n thủ c&aacute;c chỉ số bền vững của n&ocirc;ng nghiệp Mỹ: tiết kiệm nước, kỹ thuật &ldquo;kh&ocirc;ng l&agrave;m đất&rdquo; để bảo vệ đất trồng.</p>\r\n\r\n<p><strong><em>Sản phẩm xanh:&nbsp;</em></strong>CANIFA đặc biệt ch&uacute; trọng nghi&ecirc;n cứu, kiểm định chất lượng với nguy&ecirc;n liệu đầu v&agrave;o v&agrave; sản phẩm đầu ra, đ&aacute;p ứng những y&ecirc;u cầu khắt khe nhất của c&aacute;c chứng chỉ uy t&iacute;n nhất thế giới (Oeko Tex, Woolmark, WD&hellip;)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 2, 1, '1678116823_logochannel.png'),
(4, 'Đội ngũ phát triển OverGod Shop    ', '<p>Để x&acirc;y dựng được website b&aacute;n h&agrave;ng th&agrave;nh c&ocirc;ng như h&ocirc;m nay chắc chắn CEO Kh&aacute;nh phải c&oacute; những người trợ thủ đắc lực ph&iacute;a sau</p>\r\n', '', 2, 1, '1680012333_anhvbk5.jpg'),
(5, 'Chuyến đi thư giãn của đội ngũ OverGod SHOP    ', '<p>Để c&oacute; thể thoải m&aacute;i thư gi&atilde;n đầu &oacute;c v&agrave; cho ra những sản phẩm năng động th&igrave; việc đi du lịch l&agrave; một lựa chọn kh&aacute; hay để k&iacute;ch th&iacute;ch khả năng tư duy s&aacute;ng tạo của mỗi người</p>\r\n', '', 2, 1, '1680012490_anhvbk14.jpg');

