INSERT INTO `tbl_gioithieu` (`id`, `thongtingioithieu`) VALUES
(1, '<h1 style=\"text-align:center\"><span style=\"font-size:48px\">GIỚI THIỆU WEBSITE OVERGODSHOP</span></h1>\r\n\r\n<p style=\"margin-left:15px; margin-right:55px; text-align:justify\"><span style=\"font-size:22px\">Website overgodshop.com được th&agrave;nh lập nhằm &ldquo;GI&Uacute;P KH&Aacute;CH H&Agrave;NG <strong>TẠO DỰNG PHONG C&Aacute;CH</strong> BẰNG NHỮNG <strong>TUY&Ecirc;N NG&Ocirc;N THỜI TRANG</strong>&rdquo;. Xuất ph&aacute;t điểm từ lĩnh vực thời trang c&ocirc;ng sở năm 2005 v&agrave; vươn m&igrave;nh mạnh mẽ để đi đầu trong mảng c&ocirc;ng sở nam nữ cao cấp tại Việt Nam. Nhưng với &yacute; ch&iacute; lu&ocirc;n lu&ocirc;n kh&ocirc;ng ngừng vận động để thay đổi, OVERGOD SHOP nhanh ch&oacute;ng chiếm lấy thị trường thời trang nội địa v&agrave; trở th&agrave;nh thương hiệu thời trang xu hướng h&agrave;ng đầu Việt Nam phục vụ cho ph&aacute;i đẹp. V&agrave;o năm 2022, OVERGOD SHOP khẳng định vị thế bằng việc l&agrave; một trong những thương hiệu thời trang Việt hiếm hoi đủ tiềm lực tổ chức 2 Fashion Show h&agrave;ng năm. Dự kiến v&agrave;o năm 2025, thương hiệu OVERGOD SHOP sẽ c&oacute; 130 cửa h&agrave;ng tr&ecirc;n to&agrave;n quốc</span></p>\r\n\r\n<p style=\"margin-left:280px; text-align:justify\"><span style=\"font-size:22px\"><img alt=\"Không có mô tả ảnh.\" src=\"https://scontent.fhan14-2.fna.fbcdn.net/v/t1.6435-9/107185411_1359873250889911_4979029381582207072_n.jpg?_nc_cat=106&amp;ccb=1-7&amp;_nc_sid=174925&amp;_nc_ohc=uVIaiIwA4_UAX8kZxTD&amp;_nc_ht=scontent.fhan14-2.fna&amp;oh=00_AfB7BwcwF-CRryyA1lWZsr_AaCmp6m0FwowBa81AdHlogA&amp;oe=6448D835\" />​​​​​</span></p>\r\n\r\n<p style=\"margin-left:280px; text-align:justify\"><span style=\"font-size:22px\"><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CH&Acirc;N DUNG NH&Agrave; S&Aacute;NG LẬP WEBSITE OVERGOD</em></span></p>\r\n\r\n<p style=\"margin-left:15px; margin-right:55px; text-align:justify\"><span style=\"font-size:22px\"><strong>OVERGOD SHOP</strong> c&ograve;n thể hiện tinh thần, phong c&aacute;ch, l&yacute; tưởng sống v&agrave; l&agrave;m việc qua nhiều sự kiện đồng h&agrave;nh hoặc hợp t&aacute;c với c&aacute;c nghệ sĩ t&ecirc;n tuổi lớn như: Kh&aacute;nh Bells, Sơn T&ugrave;ng MTP, Hoa hậu Tiểu Vy, Rapper Đen V&acirc;u, Ca sỹ Ho&agrave;ng Th&ugrave;y Linh&hellip; . Th&ecirc;m v&agrave;o đ&oacute;, năm 2022 c&ograve;n l&agrave; một thương hiệu thời trang nam ho&agrave;n to&agrave;n mới c&oacute; t&ecirc;n l&agrave; Metagent</span></p>\r\n\r\n<p style=\"margin-left:15px; margin-right:55px; text-align:justify\"><span style=\"font-size:22px\">Cuộc khảo s&aacute;t t&acirc;m l&iacute; kh&aacute;ch h&agrave;ng đang dần kh&oacute; t&iacute;nh với mặt h&agrave;ng online n&ecirc;n OVERGOD SHOP lu&ocirc;n đồng h&agrave;nh c&ugrave;ng bạn về chất lượng sản phẩm nhằm tạo th&oacute;i quen mua sắm l&agrave;nh mạnh.</span></p>\r\n\r\n<p style=\"margin-left:15px; margin-right:55px; text-align:justify\"><span style=\"font-size:22px\">V&agrave; để cũng cố niềm tin của kh&aacute;ch h&agrave;ng tr&ecirc;n thị trường mua sắm trực tuyến tại Việt Nam, Ch&uacute;ng t&ocirc;i sẽ tận t&igrave;nh giải đ&aacute;p những b&acirc;ng khu&acirc;ng của bạn về dịch vụ đ&iacute;nh k&egrave;m đổi trả hay chiết khấu ưu đ&atilde;i. H&atilde;y thoải m&aacute;i mua sắm c&ugrave;ng overgodshop.com.</span></p>\r\n\r\n<p style=\"margin-left:15px; margin-right:55px; text-align:center\"><em><span style=\"font-size:22px\"><strong><span style=\"color:#212121\">OVERGOD SHOP</span></strong><span dir=\"ltr\" lang=\"vi\" style=\"color:#212121\"> cam kết mang lại gi&aacute; trị đ&iacute;ch thực v&agrave; một cuộc sống thịnh vượng hơn cho </span><span style=\"color:#212121\">người</span><span dir=\"ltr\" lang=\"vi\" style=\"color:#212121\"> Việt</span><span style=\"color:#212121\"> Nam</span><span dir=\"ltr\" lang=\"vi\" style=\"color:#212121\">.</span></span></em></p>\r\n');

