(24, 'ÁO KHOÁC LEN LÔNG CỪU\r\n    ', 'SKU: 77M7812', '2163000', 3, '1677756780_aokhoac1.jpg', 'Áo khoác len cổ V dài tay. Cài bằng hàng khuy kim loại phía trước vừa tạo điểm nhấn, vừa mang lại vẻ thanh lịch.\r\n\r\nChất vải len làm từ sợi len lông cừu cao cấp với những đặc tính nổi bật như mề', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 5),
(25, 'WOOL MINI SKIRT - CHÂN VÁY MINI LEN LÔNG CỪU\r\n    ', 'SKU: 30M7835', '1813000', 1, '1677756936_aokhoac2.jpg', 'Chân váy làm từ chất vải len Merino trứ danh. Cừu Merino là một giống cừu nổi tiếng về việc cho lông cừu làm len. Đây là giống cừu có bộ lông tuyệt vời với những sợi lông cực mảnh, mềm và trắn', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 5),
(26, 'MERINO WOOL - ÁO KHOÁC DẠ LÔNG CỪU\r\n    ', 'SKU: 77M7927', '5593000', 3, '1677757196_aokhoac3.jpg', 'Áo khoác cổ đức, dáng suông độ dài ngang hông. Điểm nhấn là túi vuông 1 bên thêu logo IVY moda. Cài bằng hàng khuy phía trước. ', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 5),
(27, 'LONG CHECK TRENCH COAT    ', 'SKU: 71M8012', '1745000', 3, '1677757536_aokhoac4.jpg', 'Áo khoác được thiết kế cổ hai ve to, cổ tay áo có đai mềm mại cố định ở áo. Hai hàng cúc tạo điểm nhấn. Phần eo có đai riêng để người mặc có thể thoải mái sáng tạo cách thắt dây cho thời tr', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 5),
(28, 'ÁO 2 DÂY LEN LÔNG CỪU    ', 'SKU: 12M7810', '903000', 3, '1677757743_aokhoac5.jpg', 'Thiết kế áo 2 dây croptop ôm sát tôn dáng người mặc. Chất liệu áo từ loại vải len cao cấp làm từ sợi len lông cừu Merino trứ danh. ', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 5),
(29, 'PREMIUM WOOL VEST\r\n    ', 'SKU: 77M7897', '5523000', 1, '1677757908_aokhoac6.jpg', 'Áo vest dạ cổ 2 ve, tay dài. 2 nắp túi giả tạo kiểu 2 bên, 1 khuy phía trước mix cùng phụ kiện dây xích kim loại trẻ trung, cá tính. Thông qua những đường nét tinh xảo như cầu vai sắc nét và phom dáng chu', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 5),
(33, 'ÁO MĂNG TÔ DẠ LÔNG CỪU KHÂU TAY    ', 'SKU: 77M7784', '8050000', 2, '1677851424_aokhoac8.jpg', '<p>* C&aacute;c sản phẩm thuộc d&ograve;ng cao cấp (Senora) v&agrave; &aacute;o kho&aacute;c (dạ, tweed, l&ocirc;ng, phao) chỉ giặt kh&ocirc;, tuyệt đối kh&ocirc;ng giặt ướt.</p>\r\n', '<p>&Aacute;o kho&aacute;c thiết kế cổ chữ K bản to, d&aacute;ng d&agrave;i c&ugrave;ng m&agrave;u sắc sang trọng, kiểu d&aacute;ng v&ocirc; c&ugrave;ng đẳng cấp. Với chất liệu &aacute;o l&agrave;m bằng L&ocirc;ng cừu cao cấp, kh&acirc;u tay 100% với c&aacute;c mũi kh&acirc;u được kh&acirc;u tỉ mỉ kh&eacute;o l&eacute;o kh&ocirc;ng l&agrave;m lộ chỉ.</p>\r\n', 1, 5),
(34, 'BEIGE HANDMADE WOOL\r\n    ', 'SKU: 77M6816', '5523000', 2, '1677851625_aokhoac7.jpg', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.\r\n\r\n', 'Áo khoác dạ cổ 2 ve lật khoét chữ K, tay dài. 2 túi vuông có nắp 2 bên. 4 khuy phía trước. Thông qua những đường nét tinh xảo như cầu vai sắc nét, hàng khuy và phom dáng chuẩn từng centimet đã mang đến sự khác biệt, đẳng cấp cho thiết kế cũng như người mặc.', 1, 5),
(35, 'ÁO KHOÁC CHẦN BÔNG\r\n    ', 'SKU: 70E3147', '1295000', 2, '1677865374_akn1.jpg', '- Chất liệu vải Polyester, áo may chần bông nhân tạo tác dụng giữ ấm cực tốt vào những ngày đại hàn', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 6),
(36, 'ÁO KHOÁC GIÓ CỔ MŨ\r\n    ', 'SKU: 70E3132', '627000', 3, '1677865493_akn2.jpg', 'Áo khoác gió 1 lớp phom suông rộng, giúp người mặc thoải mái trong từng cử động, nhưng đồng thời vẫn đảm bảo vừa vặn về số đo vai, độ dài tay, áo.', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 6),
(37, 'ÁO KHOÁC NAM VẢI VINILON\r\n    ', 'SKU: 70E3286', '597000', 3, '1677865566_akn3.jpg', 'Áo khoác nam vải vinilon phom suông, giúp người mặc thoải mái trong từng cử động, nhưng đồng thời vẫn đảm bảo vừa vặn về số đo vai, độ dài tay, áo.', '* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.', 1, 6),
(38, 'ÁO BOMBER NAM OVERSIZE    ', 'SKU: 70E3070', '417000', 2, '1677865779_akn4.jpg', '<p>&Aacute;o kho&aacute;c thun nam d&aacute;ng bomber (kh&ocirc;ng mũ). Cổ viền thun g&acirc;n co gi&atilde;n. Tay &aacute;o d&agrave;i bo gấu. C&oacute; 2 t&uacute;i ch&eacute;o. C&agrave;i bằng d&acirc;y k&eacute;o kh&oacute;a ph&iacute;a trư', '<p>* C&aacute;c sản phẩm thuộc d&ograve;ng cao cấp (Senora) v&agrave; &aacute;o kho&aacute;c (dạ, tweed, l&ocirc;ng, phao) chỉ giặt kh&ocirc;, tuyệt đối kh&ocirc;ng giặt ướt.</p>\r\n', 1, 6),
(39, 'ÁO KHOÁC CHẦN BÔNG\r\n    ', 'SKU: 70E3147', '1295000', 10, '1678264028_akn5.jpg', '<p>- Chất liệu vải Polyester, &aacute;o may chần&nbsp;b&ocirc;ng nh&acirc;n tạo t&aacute;c dụng giữ ấm cực tốt v&agrave;o những ng&agrave;y đại h&agrave;n</p>\r\n\r\n<p>- &Aacute;o kho&aacute;c phao d&aacute;ng su&ocirc;ng, cổ sơ m', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o kho&aacute;c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Cổ đức kh&ocirc;ng ch&acirc;n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 6),
(40, 'ÁO HOODIE NAM PHỐI MÀU    ', 'SKU: 59E3060', '387000', 3, '1678264160_akn6.jpg', '<p>Chất liệu vải d&agrave;y dặn kh&ocirc;ng nhăn, kh&ocirc;ng x&ugrave;, kh&ocirc;ng co r&uacute;t khi giặt, thấm h&uacute;t mồ h&ocirc;i tốt gi&uacute;p bạn thoải m&aacute;i vận động. Mix c&ugrave;ng quần jean, short...gi&amp;', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Kh&aacute;c</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 6),
(41, 'ÁO KHOÁC GIÓ NAM 2 LỚP\r\n    ', 'SKU: 70E3084', '417000', 2, '1678264446_akn7.jpg', '<p>&Aacute;o kho&aacute;c gi&oacute; 2 lớp (b&ecirc;n trong c&oacute; lớp lưới)&nbsp;cổ cao, tay d&agrave;i bo chun co gi&atilde;n. 2 t&uacute;i ch&eacute;o. C&agrave;i bằng d&acirc;y k&eacute;o kh&oacute;a ph&iacute;a trước. C&oacute; thể', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o kho&aacute;c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Kh&aacute;c</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 6),
(43, 'ÁO KHOÁC GIÓ DÁNG DÀI\r\n    ', 'SKU: 71E3075', '699000', 10, '1678980344_akn9.jpg', '<p>&Aacute;o kho&aacute;c gi&oacute; cổ bẻ tạo kiểu c&oacute; khuy c&agrave;i, tay &aacute;o d&agrave;i c&oacute; giắc lăng. D&aacute;ng &aacute;o su&ocirc;ng d&agrave;i tr&ecirc;n gối. C&agrave;i bằng d&acirc;y k&eacute;o kh&oacute;a. Bạ', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o kho&aacute;c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Kh&aacute;c</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 6),
(44, 'ÁO VEST DẠ\r\n    ', 'SKU: 67E1634', '870000', 5, '1678980602_avn1.jpg', '<p>&Aacute;o Vest nam kiểu d&aacute;ng trẻ trung -&nbsp;lịch l&atilde;m -&nbsp;sang trọng, ve &aacute;o nhọn, d&agrave;i tay, đ&iacute;nh khuy ở cổ tay. C&oacute; 2 t&uacute;i c&oacute; nắp hai b&ecirc;n h&ocirc;ng. C&oacute; t&uacute;i ', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o kho&aacute;c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Cổ hai ve</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 6),
