(46, 'ÁO THUN POSITIVE\r\n    ', 'SKU: 57E3379', '299000', 10, '1678980877_atn1.jpg', '<p>Chất liệu vải thun mềm mịn&nbsp;c&oacute; đặc t&iacute;nh thấm h&uacute;t mồ h&ocirc;i nhanh ch&oacute;ng, tạo cảm gi&aacute;c th&ocirc;ng tho&aacute;ng, dễ chịu khi mặc. Dễ giặt sạch, nhanh kh&ocirc; v&agrave; khả n', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Kh&aacute;c</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 6),
