(82, 'EDANA DRESS    ', 'SKU: 45S2725', '1990000', 7, '1678985634_bsl3.jpg', '<p>Đầm maxi lụa nằm trong BST Timeless v&agrave; được tr&igrave;nh diễn trong show thời trang Fall Winter 2022. Đầm d&aacute;ng d&agrave;i sang trọng&nbsp;&ocirc;m lấy cơ thể&nbsp;n&agrave;ng v&agrave; kh&eacute;o l&eacute;o che đi khuyết điểm phần h&ocirc;ng v&agrave; đ&ugrave;i. Phần ngực may nh&uacute;m vải tạo kiểu trễ vai gi&uacute;p&nbsp;bờ vai v&agrave; xương quai xanh&nbsp;được thấy r&otilde;.&nbsp;Chất liệu lụa cao cấp c&oacute; độ rủ c&agrave;ng tăng th&ecirc;m vẻ thướt tha, kiều diễm cho người mặc.</p>\r\n\r\n<p><strong>Th&ocirc;ng tin mẫu:</strong></p>\r\n\r\n<p><strong>Chiều cao:&nbsp;</strong>167 cm</p>\r\n\r\n<p><strong>C&acirc;n nặng:&nbsp;</strong>50 kg</p>\r\n\r\n<p><strong>Số đo 3 v&ograve;ng:&nbsp;</strong>83-65-93 cm</p>\r\n\r\n<p>Mẫu mặc size M</p>\r\n\r\n<p>Lưu &yacute;: M&agrave;u sắc sản phẩm thực tế sẽ c&oacute; sự ch&ecirc;nh lệch nhỏ so với ảnh do điều kiện &aacute;nh s&aacute;ng khi chụp v&agrave; m&agrave;u sắc hiển thị qua m&agrave;n h&igrave;nh m&aacute;y t&iacute;nh/ điện thoại.</p>\r\n', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Senora</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>Đầm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>C&ocirc;̉ khác</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 16),
(83, 'ĐẦM NHUNG XÒE PHỒNG\r\n    ', 'SKU: 45S2759', '2790000', 5, '1678985739_bsl4.jpg', '<p>Đầm x&ograve;e tr&ecirc;n gối, kiểu d&aacute;ng b&iacute; ng&ocirc;, thiết kế tay phồng tiểu thư c&ugrave;ng&nbsp;cổ xẻ chữ V phối vải lụa voan xếp nh&uacute;m tạo điểm nhấn cho trang phục</p>\r\n', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Senora</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>Đầm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>C&ocirc;̉ chữ V</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 16),
(84, 'EMILIA DRESS - ĐẦM DẠ HỘI CỔ YẾM\r\n    ', 'SKU: 45S2714', '2443000', 8, '1679817967_bsl5.jpg', '<p>Đầm dạ hội d&aacute;ng d&agrave;i bao gồm 2 lớp. Lớp l&oacute;t trong l&agrave; lụa mềm. Lớp ngo&agrave;i l&agrave; voan mỏng c&oacute; độ xuy&ecirc;n thấu, độ d&agrave;i chấm g&oacute;t, được nhấn tầng để tạ', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Senora</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>Đầm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>C&ocirc;̉ khác</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 15),
(85, 'ÁO THUN IN HÌNH\r\n    ', 'SKU: 57E3373', '325000', 6, '1679818145_bsl6.jpg', '<p>&Aacute;o thun tay ngắn độ d&agrave;i vừa phải mang phong c&aacute;ch trẻ trung năng động.</p>\r\n', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Kh&aacute;c</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 15),
(86, 'CHÂN VÁY XÒE NHUNG PHỐI LƯỚI\r\n    ', 'SKU: 31G1174', '155400', 5, '1679818214_bsl7.jpg', '<p>Zu&yacute;p x&ograve;e 2 lớp, nhung m&agrave;u hồng &aacute;nh nhũ phối lớp lưới m&agrave;u đen tạo x&ograve;e. Cạp chun co gi&atilde;n.</p>\r\n\r\n<p>M&agrave;u sắc: Đen</p>\r\n', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Girl</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>Zu&yacute;p</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Kiểu d&aacute;ng</strong></td>\r\n			<td>Xòe</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 15),
(87, 'ÁO KHOÁC GIÓ CỔ MŨ    ', 'SKU: 70E3085', '519100', 5, '1679818417_bsl8.jpg', '<p>&Aacute;o kho&aacute;c gi&oacute; 2&nbsp;lớp phom su&ocirc;ng rộng,&nbsp;gi&uacute;p người mặc thoải m&aacute;i trong từng cử động, nhưng đồng thời vẫn đảm bảo vừa vặn về số đo vai, độ d&agrave;i tay, &aacute;o.</p>\r\n\r\n<p>Thiết kế tỉ mỉ đến từng chi tiết đem đến cho những trải nghiệm tuyệt vời nhất trong thời tiết se lạnh với mũ liền kết cấu đặc biệt. Phần tay giắc lăng d&aacute;ng xu&ocirc;ng. 2 t&uacute;i ch&eacute;o c&oacute; d&acirc;y kh&oacute;a k&eacute;o. C&agrave;i bằng d&acirc;y kh&oacute;a ph&iacute;a trước.</p>\r\n\r\n<p>Chất liệu vinilon&nbsp;cao cấp gi&uacute;p giữ ấm, chắn mưa, gi&oacute; hiệu quả. Đặc biệt, vải nhẹ v&agrave; tho&aacute;ng, hạn chế b&aacute;m bụi, dễ chăm s&oacute;c v&agrave; bảo quản.</p>\r\n\r\n<p>Sản phẩm&nbsp;mặc c&ugrave;ng quần&nbsp;đồng bộ&nbsp;<strong>MS 20E3085</strong></p>\r\n\r\n<p><strong>Th&ocirc;ng tin mẫu:</strong></p>\r\n\r\n<p><strong>Chiều cao:&nbsp;</strong>175 cm</p>\r\n\r\n<p><strong>C&acirc;n nặng:&nbsp;</strong>70 kg</p>\r\n\r\n<p><strong>Số đo 3 v&ograve;ng:&nbsp;</strong>98-75-97 cm</p>\r\n\r\n<p>Mẫu mặc size M</p>\r\n', '<table style=\"width:70%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>D&ograve;ng sản phẩm</strong></td>\r\n			<td>Men</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Nh&oacute;m sản phẩm</strong></td>\r\n			<td>&Aacute;o kho&aacute;c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cổ &aacute;o</strong></td>\r\n			<td>Cổ mũ</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, 15);

